class Solution:
    def findKthBit(self, n: int, k: int) -> str:
        # sol =

        # Size_0 = 1
        # Size_i = Size_(i-1) + 1 + Size(i - 1) = 2 * Size(i - 1) + 1
        arr = [0]

        # k > len(arr)
        # k - 1 >= len(arr)

        while k - 1 >= len(arr):
            arr.append(1)
            arr.extend(1 - arr[i] for i in range(len(arr)-2, -1, -1))
        
        return str(arr[k - 1])

        for _ in range(n - 2 + 1):
            rest = list(map(lambda bit: 1 - bit, arr))[::-1]
            arr.append(1)
            arr.extend(rest)
        
        print(arr)
        return str(arr[k - 1])
        
        
